import React from "react";
import { CircleDiv, Number, Percent } from "./circle.style";

const Circle = () => (
  <CircleDiv>
    <Percent>
      <svg>
        <circle cx="70" cy="70" r="70" />
        <circle cx="70" cy="70" r="70" />
      </svg>
      <Number>
        <h2>50</h2>
      </Number>
    </Percent>
  </CircleDiv>
);

export default Circle;
